import React from 'react';

const styles = {
    bar: {
        height: '100%',
        minWidth: '75px',
        width: '8%',
        backgroundColor: 'rgb(24,24,24',
        textAlign: 'center',
        float: 'left'
    },
    black: {
        backgroundColor: 'black',
        marginBottom: "20vh"

    },
    secondtier: {
        marginBottom: '5vh'
    },
    seconditem: {
        display: 'block'
    },
    icons: {
        width: '70%',
    },
    icon: {
        display: 'block',
        marginBottom: '25%'
    }
}

const Sidebar = () => {

    return(

        <React.Fragment>
            <div style={styles.bar}>
                <div style={styles.black}>
                <div className="w3-padding w3-xxxlarge w3-text-white">
                <a href='/'><i className="fa fa-home"></i></a>
                </div>
                </div>
                <div style={styles.secondtier}>
                <div className="w3-padding w3-xxlarge w3-text-grey">
                <a href='/About'><i className="icon" className="fa fa-user-circle" style={styles.icons} 
                    onMouseOut={({target})=>target.style.color='grey'}
                    onMouseOver={({target})=>target.style.color='white'} ></i></a>
                <a href='/Skills'><i className="fas fa-cog" style={styles.icons} onMouseOut={({target})=>target.style.color='grey'}
                    onMouseOver={({target})=>target.style.color='white'} ></i></a>
                <a href='/Portfolio'><i className="far fa-eye" style={styles.icons} onMouseOut={({target})=>target.style.color='grey'}
                    onMouseOver={({target})=>target.style.color='white'} ></i></a>
                <a href='/Contact'><i className="far fa-envelope" style={styles.icons} onMouseOut={({target})=>target.style.color='grey'}
                    onMouseOver={({target})=>target.style.color='white'} ></i></a>
                </div>
                </div>
                <div className="w3-padding w3-xlarge w3-text-grey">
                <a href='https://www.linkedin.com/in/chase-lipscomb-982b50148/'><i class="fa fa-linkedin-square" style={styles.icon}></i></a>
                <a href='https://www.instagram.com/_chasel/'><i class="fa fa-instagram" style={styles.icon}></i></a>
                <a href='https://www.facebook.com/ChaseLipscomb97'><i class="fa fa-facebook" style={styles.icon}></i></a>
                <a href='https://github.com/chaselipscomb'><i class="fa fa-github" style={styles.icon}></i></a>


                </div>

                </div>

        </React.Fragment>
    )
}
export default Sidebar
